import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
        <Header />
        <Tech />
    </div>
  );
}

function Tech() {
    return (
        <div>
            <ul>
                <li>JS</li>
                <li>CSS</li>
                <li>HTML</li>
                <li>React</li>
            </ul>
        </div>
    )
}

function Header() {
    return (
        <div className="first">
            <a href="#">Home</a>
            <a href="#">News</a>
            <a href="#">Contacts</a>
        </div>
    );
}

export default App;
